sample: '["\"Trgovina\\nKategorije\\nTangit in Griffon\\nTangit lepila in \u010distila
  so zasnovana posebej za uporabo v plasti\u010dnih cevovodnih sistemih in so izjemna
  pri zagotavljanju zanesljivih spojev, ki z lahkoto prena\u0161ajo tudi premikanje
  in upogibanje. Kot uradni zastopnik GFPS lahko dobavljamo tudi Tangit izdelke, ki
  jih ni na tej strani.\\nLepila in \u010distila Griffon nizozemskega proizvajalca
  ponujajo hitre in zanesljive re\u0161itve za trajno lepljenje in tesnenje \u2013
  izdelki so preprosti za uporabo in zagotavljajo vrhunski kon\u010dni rezultat. Na
  voljo so tudi drugi namenski izdelki.\\nZa zahtevnej\u0161e pogoje in agresivnej\u0161e
  medije so na voljo posebna lepila: DTX je kemi\u010dno odporno lepilo, ki je gosto
  teko\u010de (in ni primerno za visoko koncentrirano \u017evepleno kislino); namensko
  lepilo Dytex iz GF-ove lastne proizvodnje pa je primerno tudi za ta namen. Za ve\u010d
  podrobnosti stopite v stik z nami ali pa preverite kemi\u010dno odpornost s spletnim
  orodjem.\\nZa podatke o odmerjanju lepil bodite pozorni na tabele pri posameznih
  lepilih.\\n\u010ceprav dr\u017eimo bogato zalogo, vseh izdelkov morda nimamo na
  zalogi. V tem primeru vas bomo v najkraj\u0161em mo\u017enem \u010dasu po oddaji
  naro\u010dila kontaktirali in se dogovorili za dobavo. Enako velja za izdelke, ki
  jih najdete v katalogu, ne pa tudi v na\u0161i spletni trgovini.\"", "\"Stroj za
  mletje in lo\u010devanje okare ter kuhanje\\nAvtomatski stroj za mletje soje in
  lo\u010devanje okare ter kuhanje\\nMletje, lo\u010devanje in kuhanje opreme je pomemben
  proces pri proizvodnji tofuja in sojinega mleka. So klju\u010dnega pomena za kakovost
  tofuja in sojinega mleka. Pri mletju soje so industrije tofuja in sojinega mleka
  zaskrbljene, koliko tofuja in sojinega mleka lahko proizvedejo, ko vstavijo vsako
  enoto soje s sojino mle\u010dno ekstraktorjem.\\nGlede vzdr\u017eevanja mlinarskih
  naprav so zaskrbljeni tudi glede \u017eivljenjske dobe mlinarskih struktur, pogostosti
  zamenjave filtrirnih mre\u017e ... itd. vzdr\u017eevalni dejavniki strojev.\\nMed
  podjetji, povezanimi z Yung Soon Lih, imamo tudi podjetje, ki proizvaja tofu in
  sojino mleko.\\nKo smo pred dvajsetimi leti za\u010deli proizvajati tofu in sojino
  mleko, smo razumeli, da oblikovanje mlinarske strukture vpliva na produktivnost
  tofuja in sojinega mleka.\\nObi\u010dajno pri proizvodnji tofuja in sojinega mleka
  razlikujemo med sistemom za zdravo pulpo in sistemom za kuhanje pulpe. Da bi zadovoljili
  razli\u010dne zahteve strank, Yung Soon Lih ponuja dve mo\u017enosti: sistem za
  zdravo pulpo in sistem za kuhanje pulpe. Ti sistemi prav tako proizvajajo tofu in
  sojino mleko, vendar imajo razli\u010dne na\u010dine delovanja. Spodaj so podrobne
  informacije:\\n* Sistem za izdelavo tofuja in sojinega mleka z zdravim pulpnim sistemom\\nHranjenje,
  mletje in lo\u010devanje hkrati, nato neposreden prenos sojinega mleka v kuhalni
  stroj. Na ta na\u010din sistem Health Pulp neposredno segreva sojino mleko. Poleg
  tega ni potrebno kuhati Okare, s \u010dimer se zmanj\u0161a poraba energije. Ko
  sojino mleko vstopi v naslednji korak, ga ni treba ponovno segrevati. Ta sistem
  vam pomaga zmanj\u0161ati porabo energije in stro\u0161ke proizvodnje.\\nSicer lahko
  merimo koncentracijo sojinega mleka, ko vstopi v postopek segrevanja. Nato lahko
  takoj prilagodimo koncentracijo sojinega mleka. Na ta na\u010din je nadzor nad koncentracijo
  sojinega mleka natan\u010dnej\u0161i in la\u017eji.\\n* Kuhani sistem pulpe za tofu
  in sojino mleko\\nPo hranjenju in mletju soje, sojino mleko in okara skupaj vstopita
  v kuhalni stroj. Nato gresta v stroj za lo\u010devanje okare, da se lo\u010dita
  na sojino mleko in okaro.\\nNa ta na\u010din je treba sojino mleko in okaro skupaj
  segreti.\\nZa mletje in lo\u010devanje soje. Stroj za mletje, lo\u010devanje in
  kuhanje soje je primeren za proizvodnjo rastlinske beljakovinske hrane, obi\u010dajnega
  tofua (trdega tofua), svilnatega tofua (mehkega tofua), ocvrtega tofua, zelenjavnega
  tofua (tofua z zelenjavo in zeli\u0161\u010di), tofuj burgerja (tofu pleskavice),
  tofuj klobase, vegetarijanskega mesa, tofuj ko\u017ee, jaj\u010dnega tofua, japonskega
  tofua, sojinega mleka (sojino mleko z dolgim rokom trajanja), sve\u017eega sojinega
  mleka, suhega tofua, dou hua (podobno tofuj pudingu).\\nZa ve\u010d informacij o
  izdelku in specifikacijah sledite povezavi spodaj.\\nPonujamo stroj za dvojno mletje
  in lo\u010devanje okare ter kuhanje s kapaciteto do 200~220 kg/uro.\\nPodrobnosti
  Dodaj na seznamStroj za mletje in lo\u010devanje okare ter kuhanje - Avtomatski
  stroj za mletje soje in lo\u010devanje okare ter kuhanje | Profesionalni dobavitelj
  opreme za predelavo soje \u017ee 32 let na Tajvanu | Yung Soon Lih Food Machine
  Co., Ltd.\\nUstanovljeno na Tajvanu leta 1989, Yung Soon Lih Food Machine Co., Ltd.
  je proizvajalec strojev za mletje, lo\u010devanje in kuhanje okare, specializiran
  za sektor soje, sojinega mleka in proizvodnje tofuja. Unikatne linije za proizvodnjo
  sojinega mleka in tofuja, zgrajene z ISO in CE certifikati, so prodane v 40 dr\u017eavah
  s trdnim ugledom.\\neversoon, blagovna znamka Yung Soon Lih Food Machine Co., Ltd.,
  je vodilni proizvajalec strojev za sojino mleko in tofu. Kot varuh varnosti hrane
  delimo svojo osnovno tehnologijo in strokovne izku\u0161nje pri proizvodnji tofuja
  s svojimi strankami po vsem svetu. Naj postanemo va\u0161 pomemben in mo\u010dan
  partner, ki bo pri\u010da rasti in uspehu va\u0161ega poslovanja.\"", "\"Dogajanje
