  vedeti.\u00ab\\nTorej, v kolikor rabite pomo\u010d, sporo\u010dite \u017eupniku
  na kakr\u0161en koli na\u010din.\"", "\"To je vpra\u0161anje, ki buri duhove. Nekateri
