  Podvodna restavracija Ithaa\"", "\"Japonska trgovina prodaja supercar sadje - preverite
  ceno nekaterih od njih\\nGovorili smo \u017ee o nekaterih plodovih, ki se prodajajo
  po nesmiselno visokih cenah v razli\u010dnih regijah planeta, se spomnite? Te vrednosti
  so tako nesmiselne, da se je o njih celo vredno spet pogovarjati, zdaj pa se osredoto\u010dimo
  le na en drag trg s sadjem v Tokiu na Japonskem.\\nResni\u010dno se zdi, da preproste
  in navadne stvari nimajo veliko prostora v De\u017eeli vzhajajo\u010dega sonca.
  \u010ce ste v Tokiu in si \u017eelite ogledati Sembiikiya Emporium, je dobro imeti
  veliko denarja, \u010de se odlo\u010dite kupiti nekaj za jesti ali podariti.\\nNajprej
  je vredno vedeti nekaj ve\u010d o ustanovi, ki ni ni\u010d drugega kot najve\u010dja
  trgovina s sadjem na planetu. Poleg tega, da se pona\u0161a z ogromno koli\u010dino
  izdelkov in zara\u010duna zelo drago za nekatere od njih, ima emporium tudi dru\u017einsko
  tradicijo, ki o\u010dara tiste, ki radi poznajo zgodovino krajev, ki jih obi\u0161\u010dejo.\\nUstanovitev
  je bila ustanovljena leta 1834 in od takrat vodi ista dru\u017eina. Posel se je
  za\u010del majhen in skromen, danes pa je scenarij povsem druga\u010den: po ocenah
  naj bi bilo od 80 do 90% prodanih izdelkov prisotnih. Na Japonskem si ljudje med
  seboj pogosto dajejo sadje ob prilo\u017enostih, kot so poroke, obiski in sre\u010danja.
  \u010ce se \u017eelite prebiti v luksuzni sadni dar za sadje, si oglejte naslednji
  seznam in nam sporo\u010dite, ali bi si upali pla\u010dati ceno teh izdelkov:\\n1
  - kvadratna lubenica\\nZa 212 dolarjev lahko enega odnesete domov. Prihaja z lokom!\\n2
  - Luksuzne jagode\\nKaj pa pla\u010dilo 69 dolarjev v zavitku 12 jagod?\\n3 - glazura
  na torti\\nTak\u0161na \u0161katla stane 159, 50 dolarja.\\n4 - Grozdje\\nVsak kup
  grozdja stane 64 dolarjev.\\n5 - Zme\u0161ajte\\nZa pakiranje \u0161estih razli\u010dnih
  sade\u017eev boste morali pla\u010dati 170 dolarjev.\"", "\"Gerard Peter Kuiper\\nGerard
  Peter Kuiper, rojen Gerrit Pieter Kuiper, ameri\u0161ki astronom nizozemskega rodu,
  * 7. december 1905, Harenkarspel, Noord-Holland, Nizozemska, \u2020 23. december
  1973, Mexico City, Mehika.\\n\u017divljenje in delo[uredi | uredi kodo]\\nKuiper
  je leta 1927 diplomiral na Univerzi v Leidnu in tukaj leta 1933 doktoriral. Tega
  leta se je odselil v ZDA in je postal znanstveni sodelavec Observatorija Lick Univerze
  Kalifornije.\\nLeta 1936 je od\u0161el na Univerzo v Chicago, kjer je leta 1943
  postal profesor astronomije. Od leta 1936 je delal na Observatoriju Yekes v Williams
  Bayu v Wisconsinu. V letu 1937 je postal ameri\u0161ki dr\u017eavljan.\\nV Oson\u010dju
  je odkril veliko naravnih satelitov (lun) planetov. Bil je odli\u010den spektroskopist
  in leta 1944 je odkril, da ima najve\u010dji Saturnov satelit Titan atmosfero, ki
  vsebuje metan in amonijak. To je edini naravni satelit, za katerega danes vemo,
  da ima atmosfero. Teorije so ga pripeljale na misel, da ima morda tudi Neptunov
  satelit Triton atmosfero. Vendar je Triton tako dale\u010d, da tega ni mogo\u010de
  ugotoviti. Mase drugih satelitov so premajhne, temperature pa previsoke, da bi lahko
  zadr\u017eali atmosfere.\\nMed leti 1947 do 1949 in ponovno med 1957 do 1960 je
  bil predstojnik Observatorija Yerkes. Leta 1948 je zaznal CO2 v Marsovi atmosferi
  in ugotovil, da je Marsova atmosfera sestavljena ve\u010dinoma iz CO2, kar je pozneje
  potrdila vesoljska sonda Mariner. Z raziskovanjem infrarde\u010de svetlobe je pokazal,
  da sta Marsovi polarni kapi iz ledu in ne iz zmrznjenega CO2, kot so nekateri mislili,
  in kar sta pozneje potrdili sondi Viking. Istega leta je z 2.080 mm zrcalnim daljnogledom
  na Observatoriju McDonald v Catalini v Teksasu odkril Uranov 5. satelit Mirando,
  ki je najmanj\u0161a in planetu najbli\u017eja, leta 1949 pa majhen Neptunov 2.
  satelit Nereido, ki ima izsredni tir. Istega leta je postavil podobno teorijo o
  nastanku Oson\u010dja kot je bila von Weizs\u00e4ckerjeva. Tega leta je ustanovil
  in bil tudi prvi predstojnik Laboratorija za prou\u010devanje Lune in planetov (Lunar
  and Planetary Laboratory) v Tusconu v Arizoni. Za razliko od drugih sodobnih astronomov
  se je Kuiper zanimal predvsem za Luno in planete.\\nLeta 1951 je utrdil in raz\u0161iril
  Weizs\u00e4ckerjevo teorijo o nastanku Oson\u010dja, ki je v osnovi delno podobna
  Laplaceovi in je v glavnem zamenjala dramati\u010dno sliko Georga Darwina o tem,
  kako se je Luna odtrgala od Zemlje. Meglica, polna prahu in plinov, ki je kro\u017eila
  okoli mladega Sonca je postala s \u010dasom nestabilna in se je razbila na manj\u0161e
  plinske oblake, ki jih je imenoval protoplaneti. Sedanji planeti so samo majhni
  ostanki teh protoplanetov, najve\u010dji del njihove mase je odpihalo korpuskularno
  sevanje Sonca. Planeti podobni Zemlji se po njemu niso zelo spremenili glede na
  maso skozi geolo\u0161ko evolucijo. Velika temperatura v njihovi notranjosti je
  lahko posledica radioaktivnih procesov v njihovih sredi\u0161\u010dih. Sateliti
  planetov so nastali na enak na\u010din kot planeti in so bili neodvisne zgostitve.
  \u010ceprav je njegova teorija dobro razdelana, vseeno vsebuje pomankljivosti, ki
  so v splo\u0161nem zna\u010dilne za klasi\u010dne pristope kozmogoniji. Njegovo
  delo je znova zbudilo zanimanje za astronomijo Oson\u010dja. Kuiper je za opazovanja
  pogosto uporabljal 5.080 mm daljnogled na Mt. Palomarju. Opazoval je Saturnove obro\u010de
  in ugotovil, da je znana Cassinijeva lo\u010dnica edina prava vrzel med njimi. Seveda
  se je motil, saj danes vemo, da je sestav obro\u010dev izredno zamotan sestav s
  tiso\u010di in tiso\u010di obro\u010dev in vrzelmi med njimi. Posnel je tudi ene
  najlep\u0161ih slik Jupitra in Saturna z Zemlje s 1.550 mm zrcalnim daljnogledom
  na Observatoriju McDonald.\\nSku\u0161al je dolo\u010diti premer Plutona in ga je
  izmeril skoraj tako velikega kot je Zemlja. Tudi tu se je motil, saj je Pluton celo
  manj\u0161i od Lune, vendar je prvi pokazal, da je manj\u0161i kot so mislili prej.\\nKo
  je Sovjetska zveza oktobra 1957 izstrelila prvi umetni satelit Sputnik 1, je igral
  pomembno vlogo. V Laboratoriju za prou\u010devanje Lune in planetov so izdelali
  natan\u010den fotografski atlas Lune, ki je bil izrednega pomena za izbor pristajalnih
  mest ne samo za samodejne sonde, temve\u010d tudi kasneje za odprave programa Apollo.
  Leta 1960 je bil vodja skupine v okviru tega laboratorija, ki je z vesoljsko raketo
  Ranger, opravljala poskuse s trki in pristajanjem na Luni. Z analizo Rangerjevih
  fotografij, je predvidel mnoga mogo\u010da pristajalna podro\u010dja za bodo\u010de
  odprave na Luni.\\nZavedal se je, kako pomembna je prava dolo\u010ditev mesta za
  postavitev velikih observatorijev. Ko so ga zadol\u017eili, da poi\u0161\u010de
  mesto, je dolgo \u010dasa iskal in nato predlagal ugasel ognjenik na Mauna Kei na
  Havajih. Bil je prepri\u010dan, da se da tu zgraditi velik observatorij, saj je
  podro\u010dje na nadmorski vi\u0161ini 4200 m iznad ve\u010dine gostega Zemljinega
  ozra\u010dja. Glede na to, da je delo na taki vi\u0161ini zaradi redkega ozra\u010dja
  ote\u017eeno, je naletel na nasprotovanja. Vendar je vse prepreke premagal in danes
  je Mauna Kea eno najpomembnej\u0161ih astronomskih opazovalnih sredi\u0161\u010d.\\nPriznanja[uredi
  | uredi kodo]\\nPoimenovanja[uredi | uredi kodo]\\nPo njem se v zahvalo za njegove
  dose\u017eke imenuje Nasin Kuiperjev zra\u010dni observatorij (Nasa Kuiper Airbone
  Observatory), z 910 mm daljnogledom, pritrjenim na posebno predelano voja\u0161ko
  transportno letalo Lockheed C-141A Starlifter. Iz njega najve\u010d prou\u010dujejo
  sredi\u0161\u010da galaksij kot tudi sredi\u0161\u010de na\u0161e Galaksije.\\nPo
  njem se imenuje tudi domnevni asteroidni Kuiperjev pas (oblak) okrog Oson\u010dja
  zunaj Neptunovega tira, ki je bli\u017eji od Oortovega oblaka, in v katerem naj
  bi nastajali kometi. Pas je prvi leta 1949 predlagal Edgeworth, Kuiper pa ga je
  leta 1951 \u0161e dodatno utemeljil. V astronomiji se je dokon\u010dno utrdil \u0161ele
  po letu 1980. Takrat so ra\u010dunalni\u0161ke simulacije pokazale, da je v Kuiperjevem
  pasu najverjetnej\u0161i izvor kratkoperiodi\u010dnih kometov. Po prej\u0161nji
  domnevi naj bi bil njihov izvor v bolj oddaljenem Oortovem oblaku, vendar se je
  izkazalo, da kometi, ki bi prihajali od tako dale\u010d, ne bi mogli razviti svojih
  zna\u010dilnih tirov.\\nPrav tako nosi njegovo ime prvi krater, ki so ga odkrili
  na Merkurju.\"", "\"Maska obraza absorbira odve\u010dni sebum in ne\u010disto\u010de
  in ne\u017eno o\u010disti brez su\u0161enja ko\u017eo. Maska ima protivnetni in
